import { withRouter } from 'react-router-dom';
import React, { Component, Fragment } from 'react';


class Home extends Component {
    render() {
        return (
            <Fragment>


                <div className="row">
                    <div className="col-md-6 offset-3">
                        <h1>Frequently Asked Questions </h1>
                        <text> Who are we?</text>
                        <text> We are carlet, a car sharing startup aiming to make renting cars easier by bringing you to others who are willing to rent their vehicle out</text>
                        <text> Why choose us?</text>
                        <text> We link you directly with renters, you have full clarity over the whole process and our full support throughout</text>
                        <text> I just found a deal on site X which is better than what you have</text>
                        <text> Carlet doesn't set the price for the rentals, we only provide users with a bridge between them and renters, our service charges are amongst the lowest in the industry</text>
                        <text> Why list your car?</text>
                        <text> The answer is simple,since our service charges are minimal, you are able to get more for less, while still having all the benefits of any other company!</text>
                    </div>
                </div>

            </Fragment>
        );
    }
}
export default withRouter(Home);
